pub struct Clipper {
  lookup_table: [f32; 4096]
}

impl Clipper {
  pub fn new() -> Self {
    Self {
      lookup_table: LOOKUP_TABLE
    }
  }

  fn linear_interp(&self, index: usize, mix: f32) -> f32 {
    let x = self.lookup_table[index];
    let y = self.lookup_table[index + 1];
    x * (1. - mix) + y * mix
  }

  pub fn process(&self, input: f32) -> f32 {
    let table_length = self.lookup_table.len() - 1;
    let phase: f32 = input * 0.111111 + 0.5;
    let index = phase * table_length as f32;
    let truncated_index = index.trunc();
    let mix = index - truncated_index;
    
    if truncated_index >= table_length as f32 {
      self.lookup_table[table_length]
    } else if truncated_index <= 0. {
      self.lookup_table[0]
    } else {
      self.linear_interp(truncated_index as usize, mix)
    }
  }
}

