#[cfg(test)]
mod tests {
  use crate::clipper::{Clipper, LOOKUP_TABLE};

  fn assert_approximately_eq(left: f32, right: f32) {
    assert_eq!((left * 1000.).floor() / 1000., (right * 1000.).floor() / 1000.)
  }

  #[test]
  fn should_return_zero_for_zero_input() {
    let clipper = Clipper::new();
    assert_approximately_eq(clipper.process(0.), 0.)
  }

  #[test]
  fn should_clip_big_numbers() {
    let clipper = Clipper::new();
    assert_eq!(clipper.process(5.), *LOOKUP_TABLE.last().unwrap());
    assert_eq!(clipper.process(-5.), *LOOKUP_TABLE.first().unwrap());
  }

  #[test]
  fn should_be_between_minus_one_and_one() {
    let clipper = Clipper::new();
    assert!(clipper.process(0.5) > -1. && clipper.process(0.5) < 1.);
    assert!(clipper.process(2.) > -1. && clipper.process(2.) < 1.);
    assert!(clipper.process(-3.) > -1. && clipper.process(-3.) < 1.);
  }
}